import React from "react";
import { Loader } from "@googlemaps/js-api-loader";

const Map = () => {
  const map = new google.maps.Map(
    document.getElementById("map"),
    {
      zoom: 4,
      center: { lat: -25.344, lng: 131.036 },
    }
  );
  return map;
};

export default Map;
